      mosnters: [
        {
          name: 'Frankenstein'
        },
        {
          name: 'Dracula'
        },
        {
          name: 'Zombie'
        }
      ]
    };
  }
  render() {
    return (
      <div className='App'>
       {
         this.state.mosnters.map(monster => (
           monster.na
         ))
       }
      </div>
    );
  }
}

export default App;
